"cornerCellBorderColor\\\",\\\"rgba(202, 202, 202, 1)\\\"]\",\"[\\\"editCellBackgroundColor\\\",\\\"white\\\"]\",\"[\\\"editCellBorder\\\",\\\"solid 1px rgba(110, 168, 255, 1)\\\"]\",\"[\\\"editCellBoxShadow\\\",\\\"0 2px 5px rgba(0,0,0,0.4)\\\"]\",\"[\\\"editCellColor\\\",\\\"black\\\"]\",\"[\\\"editCellFontFamily\\\",\\\"sans-serif\\\"]\",\"[\\\"editCellFontSize\\\",\\\"16px\\\"]\",\"[\\\"editCellPaddingLeft\\\",4]\",\"[\\\"editCellZIndex\\\",10000]\",\"[\\\"frozenMarkerHoverColor\\\",\\\"rgba(236, 243, 255, 1)\\\"]\",\"[\\\"frozenMarkerHoverBorderColor\\\",\\\"rgba(110, 168, 255, 1)\\\"]\",\"[\\\"frozenMarkerActiveColor\\\",\\\"rgba(236, 243, 255, 1)\\\"]\",\"[\\\"frozenMarkerActiveBorderColor\\\",\\\"rgba(110, 168, 255, 1)\\\"]\",\"[\\\"frozenMarkerColor\\\",\\\"rgba(222, 222, 222, 1)\\\"]\",\"[\\\"frozenMarkerBorderColor\\\",\\\"rgba(168, 168, 168, 1)\\\"]\",\"[\\\"frozenMarkerBorderWidth\\\",1]\",\"[\\\"frozenMarkerWidth\\\",2]\",\"[\\\"gridBackgroundColor\\\",\\\"rgba(240, 240, 240, 1)\\\"]\",\"[\\\"gridBorderCollapse\\\",\\\"collapse\\\"]\",\"[\\\"gridBorderColor\\\",\\\"rgba(202, 202, 202, 1)\\\"]\",\"[\\\"gridBorderWidth\\\",1]\",\"[\\\"minColumnWidth\\\",45]\",\"[\\\"minRowHeight\\\",24]\",\"[\\\"mobileContextMenuMargin\\\",10]\",\"[\\\"mobileEditInputHeight\\\",30]\",\"[\\\"mobileEditFontFamily\\\",\\\"sans-serif\\\"]\",\"[\\\"mobileEditFontSize\\\",\\\"16px\\\"]\",\"[\\\"moveOverlayBorderWidth\\\",1]\",\"[\\\"moveOverlayBorderColor\\\",\\\"rgba(66, 133, 244, 1)\\\"]\",\"[\\\"moveOverlayBorderSegments\\\",\\\"12, 7\\\"]\",\"[\\\"name\\\",\\\"default\\\"]\",\"[\\\"reorderMarkerBackgroundColor\\\",\\\"rgba(0, 0, 0, 0.1)\\\"]\",\"[\\\"reorderMarkerBorderColor\\\",\\\"rgba(0, 0, 0, 0.2)\\\"]\",\"[\\\"reorderMarkerBorderWidth\\\",1.25]\",\"[\\\"reorderMarkerIndexBorderColor\\\",\\\"rgba(66, 133, 244, 1)\\\"]\",\"[\\\"reorderMarkerIndexBorderWidth\\\",2.75]\",\"[\\\"rowHeaderCellBackgroundColor\\\",\\\"rgba(240, 240, 240, 1)\\\"]\",\"[\\\"rowHeaderCellBorderColor\\\",\\\"rgba(200, 200, 200, 1)\\\"]\",\"[\\\"rowHeaderCellBorderWidth\\\",1]\",\"[\\\"rowHeaderCellColor\\\",\\\"rgba(50, 50, 50, 1)\\\"]\",\"[\\\"rowHeaderCellFont\\\",\\\"16px sans-serif\\\"]\",\"[\\\"rowHeaderCellHeight\\\",25]\",\"[\\\"rowHeaderCellHorizontalAlignment\\\",\\\"left\\\"]\",\"[\\\"rowHeaderCellHoverBackgroundColor\\\",\\\"rgba(235, 235, 235, 1)\\\"]\",\"[\\\"rowHeaderCellHoverColor\\\",\\\"rgba(0, 0, 0, 1)\\\"]\",\"[\\\"rowHeaderCellPaddingBottom\\\",5]\",\"[\\\"rowHeaderCellPaddingLeft\\\",5]\",\"[\\\"rowHeaderCellPaddingRight\\\",5]\",\"[\\\"rowHeaderCellPaddingTop\\\",5]\",\"[\\\"rowHeaderCellSelectedBackgroundColor\\\",\\\"rgba(217, 217, 217, 1)\\\"]\",\"[\\\"rowHeaderCellSelectedColor\\\",\\\"rgba(50, 50, 50, 1)\\\"]\",\"[\\\"rowHeaderCellVerticalAlignment\\\",\\\"center\\\"]\",\"[\\\"rowHeaderCellWidth\\\",57]\",\"[\\\"scrollBarActiveColor\\\",\\\"rgba(125, 125, 125, 1)\\\"]\",\"[\\\"scrollBarBackgroundColor\\\",\\\"rgba(240, 240, 240, 1)\\\"]\",\"[\\\"scrollBarBorderColor\\\",\\\"rgba(202, 202, 202, 1)\\\"]\",\"[\\\"scrollBarBorderWidth\\\",0.5]\",\"[\\\"scrollBarBoxBorderRadius\\\",4.125]\",\"[\\\"scrollBarBoxColor\\\",\\\"rgba(192, 192, 192, 1)\\\"]\",\"[\\\"scrollBarBoxMargin\\\",2]\",\"[\\\"scrollBarBoxMinSize\\\",15]\",\"[\\\"scrollBarBoxWidth\\\",8]\",\"[\\\"scrollBarCornerBackgroundColor\\\",\\\"rgba(240, 240, 240, 1)\\\"]\",\"[\\\"scrollBarCornerBorderColor\\\",\\\"rgba(202, 202, 202, 1)\\\"]\",\"[\\\"scrollBarWidth\\\",11]\",\"[\\\"selectionHandleBorderColor\\\",\\\"rgba(255, 255, 255, 1)\\\"]\",\"[\\\"selectionHandleBorderWidth\\\",1.5]\",\"[\\\"selectionHandleColor\\\",\\\"rgba(66, 133, 244, 1)\\\"]\",\"[\\\"selectionHandleSize\\\",8]\",\"[\\\"selectionHandleType\\\",\\\"square\\\"]\",\"[\\\"selectionOverlayBorderColor\\\",\\\"rgba(66, 133, 244, 1)\\\"]\",\"[\\\"selectionOverlayBorderWidth\\\",1]\",\"[\\\"treeArrowBorderColor\\\",\\\"rgba(195, 199, 202, 1)\\\"]\",\"[\\\"treeArrowBorderWidth\\\",1]\",\"[\\\"treeArrowClickRadius\\\",5]\",\"[\\\"treeArrowColor\\\",\\\"rgba(155, 155, 155, 1)\\\"]\",\"[\\\"treeArrowHeight\\\",8]\",\"[\\\"treeArrowMarginLeft\\\",0]\",\"[\\\"treeArrowMarginRight\\\",5]\",\"[\\\"treeArrowMarginTop\\\",6]\",\"[\\\"treeArrowWidth\\\",13]\",\"[\\\"treeGridHeight\\\",250]\"]"
